(41, 'apa-itu-ikahimatika', 'Apa itu IKAHIMATIKA?', 'storage/v1o0odkW30ihqjG9epsPvhtA6ovPrFJA3KMElkA7.png', 'IKAHIMATIKA merupakan satu-satunya organisasi tingkat nasional yang menaungi himpunan mahasiswa matematika seluruh indonesia. IKAHIMATIKA Indonesia', '<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(33, 37, 41);font-family:Poppins, sans-serif;font-size:12px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">IKAHIMATIKA merupakan satu-satunya organisasi tingkat nasional yang menaungi himpunan mahasiswa matematika seluruh indonesia. IKAHIMATIKA Indonesia didirikan di Bandung pada tanggal 10 Desember 1998. Sekretariat IKAHIMATIKA Indonesia berkedudukan di kota tempat Sekretaris Jenderal terpilih berkuliah.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(33, 37, 41);font-family:Poppins, sans-serif;font-size:12px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">IKAHIMATIKA Indonesia berasaskan Pancasila. IKAHIMATIKA Indonesia berlandaskan keilmuan dan keprofesian. IKAHlMATIKA Indonesia bersifat ilmiah, profesional, dan independen. IKAHIMATIKA Indonesia bertujuan menggalang kerjasama antar himpunan Mahasiswa Matematika di seluruh Indonesia untuk Menjalankan fungsi sebagai mahasiswa dan membangun&nbsp; kultur tentang kematematikaan.IKAHIMATIKA Indonesia berfungsi sebagai wadah pemersatu peran himpunan.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(33, 37, 41);font-family:Poppins, sans-serif;font-size:12px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Peran IKAHIMATIKA:<br>1.Menyelenggarakan forum pertemuan untuk menelaah, membahas masalah yang dihadapi dalam usaha pengembangan matematika.<br>2.Mengaplikasikan bidang Matematika sejalan dengan kemajuan ilmu yang ada untuk masyarakat.<br>3.Menjalin kerjasama yang erat dengan organisasi yang sejenis, lembaga-lembaga dan instansi pemerintah maupun swasta.<br>Anggota IKAHIMATIKA adalah himpunan mahasiswa matematika di seluruh Indonesia yang sudah terdaftar dan memenuhi persyaratan yang ditentukan.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(33, 37, 41);font-family:Poppins, sans-serif;font-size:12px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Ikatan Himpunan Mahasiswa Matematika Indonesia mempunyai wilayah hukum di seluruh Indonesia, pembagian wilayah hukum sebagai berikut:<br>a.Wilayah I&nbsp;&nbsp; &nbsp;: NAD, Sumatera Utara, Riau, Sumatera Barat, Jambi, kep Riau.<br>b.Wilayah II&nbsp;&nbsp; &nbsp;: Sumatera Selatan, Lampung, Bengkulu, Bangka belitung.<br>c.Wilayah III&nbsp;&nbsp; &nbsp;: DKI Jakarta, Jawa Barat, Kalimantan Barat, Banten.<br>d.Wilayah IV&nbsp;&nbsp; &nbsp;: DI Yogyakarta dan Jawa Tengah.<br>e.Wilayah V&nbsp;&nbsp; &nbsp;: Jawa Timur, Bali, NTT, NTB, Kalimantan Selatan,Kalimantan Timur&nbsp;&nbsp;&nbsp; dan&nbsp;&nbsp; Kalimantan Tengah<br>f.Wilayah VI&nbsp;&nbsp; &nbsp;: Maluku, Maluku Utara, Papua, Papua Barat, Sulawesi Selatan, Sulawesi Utara,Sulawesi Barat, Sulawesi Tengah, Sulawesi Tenggara, Gorontalo.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(33, 37, 41);font-family:Poppins, sans-serif;font-size:12px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sumber :&nbsp;<a style=\"box-sizing:border-box;color:rgb(13, 110, 253);font-family:Poppins, sans-serif;font-size:12px;\" href=\"https://ikahimatika.or.id/main/sample-page/\"><u>About – IKAHIMATIKA INDONESIA</u></a></p>', 'Admin', 0, '2022-10-04 16:24:00', '2022-10-04 16:24:00');
