(43, 'divisi-divisi-yang-ada-di-himaptika-fkip-ulm-periode-2022-2023', 'Divisi-divisi yang Ada di HIMAPTIKA FKIP ULM Periode 2022/2023', 'storage/FCooCfw7urhWlnDGJUfSDYUNmccr48kgS2db6sRx.jpg', 'Berikut Divisi-divisi yang Ada di HIMAPTIKA FKIP ULM Periode 2022/2023', '<h2 style=\"text-align: center;\">Divisi-divisi yang Ada di HIMAPTIKA FKIP ULM Periode 2022-2023</h2>\n<p>Berikut merupakan deskripsi tiap divisi yang ada di HIMAPTIKA FKIP ULM</p>\n<div id=\"accordionPanelsStayOpenExample\" class=\"accordion accordion-flush\">\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingOne\" class=\"accordion-header\"><button class=\"accordion-button\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseOne\" aria-expanded=\"true\" aria-controls=\"panelsStayOpen-collapseOne\"> <strong>1. Divisi Kaderisasi</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseOne\" class=\"accordion-collapse collapse show\" aria-labelledby=\"panelsStayOpen-headingOne\">\n<div class=\"accordion-body\">Divisi Kaderisasi adalah divisi yang ada untuk mempersiapkan para kader baru guna melanjutkan tongkat estafet perjuangan sebuah organisasi. Divisi Kaderisasi bertugas dalam memantau, memotivasi, dan mengakrabkan anggota maupun pengurus HIMAPTIKA.</div>\n</div>\n</div>\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingTwo\" class=\"accordion-header\"><button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseTwo\" aria-expanded=\"false\" aria-controls=\"panelsStayOpen-collapseTwo\"> <strong>2. Divisi Pendidikan</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseTwo\" class=\"accordion-collapse collapse\" aria-labelledby=\"panelsStayOpen-headingTwo\">\n<div class=\"accordion-body\">Divisi pendidikan merupakan divisi yang mewadahi kegiatan-kegiatan mahasiswa yang berkaitan dengan bidang pendidikan. Program-program divisi pendidikan berfokus pada pengembangan kompetensi dan daya saing mahasiswa serta masyarakat (terutama pelajar) di bidang akademis, melalui kegiatan pelatihan, bimbingan belajar, penyebaran informasi, dan pengadaan kompetisi.</div>\n</div>\n</div>\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingThree\" class=\"accordion-header\"><button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseThree\" aria-expanded=\"false\" aria-controls=\"panelsStayOpen-collapseThree\"> <strong>3. Divisi Minat dan Bakat</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseThree\" class=\"accordion-collapse collapse\" aria-labelledby=\"panelsStayOpen-headingThree\">\n<div class=\"accordion-body\">Divisi Minat &amp; Bakat adalah divisi yang bergerak di bidang minat dan bakat yang meliputi olahraga dan seni, dimana tujuannya adalah untuk mewadahi minat dan bakat mahasiswa aktif pendidikan matematika FKIP ULM</div>\n</div>\n</div>\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingFour\" class=\"accordion-header\"><button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseFour\" aria-expanded=\"false\" aria-controls=\"panelsStayOpen-collapseFour\"> <strong>4. Divisi Kewirausahaan Sosial Masyarakat</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseFour\" class=\"accordion-collapse collapse\" aria-labelledby=\"panelsStayOpen-headingFour\">\n<div class=\"accordion-body\">Divisi Kewirausahaan &amp; Sosial Masyarakat adalah divisi yang membantu pengurus dalam berwirausaha serta berjiwa sosial yang tinggi dalam lingkup masyarakat.</div>\n</div>\n</div>\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingFive\" class=\"accordion-header\"><button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseFive\" aria-expanded=\"false\" aria-controls=\"panelsStayOpen-collapseFive\"> <strong>5. Divisi Informasi dan Komunikasi</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseFive\" class=\"accordion-collapse collapse\" aria-labelledby=\"panelsStayOpen-headingFive\">\n<div class=\"accordion-body\">Divisi INFOKOM adalah divisi yang bertugas untuk mengelola informasi yang masuk dan keluar dari HIMAPTIKA FKIP ULM dalam bentuk cetak maupun elektronik dan membantu divisi lain dalam memberikan sarana penyaluran informasi dan publikasi</div>\n</div>\n</div>\n<div class=\"accordion-item\">\n<h2 id=\"panelsStayOpen-headingSix\" class=\"accordion-header\"><button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#panelsStayOpen-collapseSix\" aria-expanded=\"false\" aria-controls=\"panelsStayOpen-collapseSix\"> <strong>6. Divisi Kerohanian</strong> </button></h2>\n<div id=\"panelsStayOpen-collapseSix\" class=\"accordion-collapse collapse\" aria-labelledby=\"panelsStayOpen-headingSix\">\n<div class=\"accordion-body\">Divisi kerohanian adalah salah satu divisi yang ada di HIMAPTIKA FKIP ULM. Divisi kerohanian di Himaptika memiliki fokus untuk membentuk kader yang beragama di pengurus Himaptika.</div>\n</div>\n</div>\n</div>', 'Admin', 0, '2022-10-04 16:32:03', '2022-10-04 16:32:03'),
